  <script>
    var paths = document.querySelectorAll("path");
    for (var i = 0, n = paths.length; i < n; i++) {
        var p = paths[i];
        p.onclick = function (ev) {
            console.log(ev.target.getAttribute("data-num"));
        }
    }
    // random colours
    var leaves = document.querySelectorAll("g > path:not(.bark)")
        // hue: red, orange, yellow, green, blue, purple, pink, monochrome
        // luminosity: light
    ,   colours = randomColor({ hue: "green", count: leaves.length })
    ;
    for (var i = 0, n = leaves.length; i < n; i++)
        leaves[i].setAttributeNS(null, "fill", colours[i])
    // random colours - bark
    var barks = document.querySelectorAll("path.bark")
        // hue: red, orange, yellow, green, blue, purple, pink, monochrome
        // luminosity: light
    ,   barkColours = randomColor({ hue: "orange", count: barks.length })
    ;
    for (var i = 0, n = barks.length; i < n; i++)
        barks[i].setAttributeNS(null, "fill", barkColours[i])
  </script>
